import React, { Component } from "react";
import { Autocomplete, TextField, Button } from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";
import "./QuanLyNguoiDung.css";
export default class QuanLyNguoiDung extends Component {
  constructor(props) {
    super(props);
    this.state = {
      listUser: [],
    };
  }
  componentDidMount() {
    this.props.getAllUser();
  }
  handleClick = (value) => {
    console.log(value.row);
  };
  componentDidUpdate(prevProps) {
    if (prevProps.listUser !== this.props.listUser) {
      this.setState({
      });
    }
  }
  render() {
    const columns = [
      { field: "id", headerName: "ID", width: 70, headerAlign: "center" },
      {
        field: "firstName",
        headerName: "Username",
        width: 200,
        headerAlign: "center",
      },
      {
        field: "lastName",
        headerName: "Email",
        width: 200,
        headerAlign: "center",
      },
      {
        field: "age",
        headerName: "Password",
        width: 100,
        headerAlign: "center",
      },
      {
        field: "age",
        headerName: "Createday",
        width: 100,
        headerAlign: "center",
      },
      {
        field: "button",
        headerName: "Action",
        width: 200,
        renderCell: (cellValues) => {
          return (
            <>
              <Button
                className="edit"
                variant="contained"
                color="success"
                onClick={() => this.handleClick(cellValues)}
              >
                Sửa
              </Button>
              <Button
                variant="contained"
                color="warning"
                onClick={() => this.handleClick(cellValues)}
              >
                Xóa
              </Button>
            </>
          );
        },
        headerAlign: "center",
      },
    ];

    const rows = [
      {
        id: 1,
        lastName: "Snow",
        firstName: "Jon",
        age: 35,
        headerAlign: "center",
      },
      {
        id: 2,
        lastName: "Lannister",
        firstName: "Cersei",
        age: 42,
      },
      {
        id: 3,
        lastName: "Lannister",
        firstName: "Jaime",
        age: 45,
      },
      {
        id: 4,
        lastName: "Stark",
        firstName: "Arya",
        age: 16,
      },
      {
        id: 5,
        lastName: "Targaryen",
        firstName: "Daenerys",
        age: null,
      },
      {
        id: 6,
        lastName: "Melisandre",
        firstName: null,
        age: 150,
      },
      {
        id: 7,
        lastName: "Clifford",
        firstName: "Ferrara",
        age: 44,
      },
      {
        id: 8,
        lastName: "Frances",
        firstName: "Rossini",
        age: 36,
      },
      {
        id: 9,
        lastName: "Roxie",
        firstName: "Harvey",
        age: 65,
      },
    ];
    return (
      <div className="container">
        <div className="form">
          <TextField
            className="input"
            id="outlined-basic"
            label="Outlined"
            variant="outlined"
            size="small"
          />
          <TextField
            className="input"
            id="filled-basic"
            label="Filled"
            variant="outlined"
            size="small"
          />
          <TextField
            className="input"
            id="standard-basic"
            label="Standard"
            variant="outlined"
            size="small"
          />
          <Button variant="outlined">Đăng Kí</Button>
        </div>
        <div className="data">
          <DataGrid rows={rows} columns={columns} pageSize={8} />
        </div>
      </div>
    );
  }
}
